import React from 'react'

function Profile() {

  /* const style1 = {
    'display': 'flex',
  }

  const style2 = {
    'display='block', 
    marginLeft='auto', 
    marginRight='20px', 
    width='150px'
  }
 */

  const goMyData = () => {
    window.location.href = "http://localhost:3000/myData";
  }

  const goConsumidor = () => {
    window.location.href = "http://localhost:3000/consumidor";
  }

  const goFornecedor = () => {
    window.location.href = "http://localhost:3000/fornecedor";
  }

  const goTransportador = () => {
    window.location.href = "http://localhost:3000/trasnportador";
  }

  return (
    <div className="container">
      <div className="container">
        <br />
        <h3>A minha conta</h3>
      </div>
      <br />
      <br />
      <div className="container">
      <table className="table table-bordered">
        <thead>
        </thead>
        <tbody> 
        <tr>
          <td style={{display: 'flex', backgroundColor: 'grey'}} ><h3>Editar os meus dados</h3> <Link to ='/href' ><button type="button" className="btn btn btn-primary" style={{display:'block', marginLeft:'auto', marginRight:'20px', width:'150px'}}  >Editar</button></Link></td>
          </tr>
          <tr>
          <td style={{display: 'flex', backgroundColor: 'grey'}} ><h3>Sou Consumidor</h3> <button type="button" className="btn btn btn-primary" style={{display:'block', marginLeft:'auto', marginRight:'20px', width:'150px'}} >Ver</button></td>
          </tr>
          <tr>
          <td style={{display: 'flex', backgroundColor: 'grey'}} ><h3>Sou Fornecedor</h3> <button type="button" className="btn btn btn-primary" style={{display:'block', marginLeft:'auto', marginRight:'20px', width:'150px'}} >Ver</button></td>
          </tr>
          <tr>
          <td style={{display: 'flex', backgroundColor: 'grey'}} ><h3>Sou Transportador</h3> <button type="button" className="btn btn btn-primary" style={{display:'block', marginLeft:'auto', marginRight:'20px', width:'150px'}} >Tornar-me</button></td>
          </tr>
        </tbody>
        </table>
      </div>
      <p>Ola</p>
      <p>Adeus</p>
      <p>ate</p>
      <p>onde</p>
      <p>vai</p>
      <p>a</p>
      <p>pagina</p>
    </div>
  )
}

export default Profile;
